basics/.body:
अध्याय २
आधारभूत कुराहरू
यस पहिलो अध्यायमा हामी प्रोग्रामिंग र जाभास्क्रिप्ट भाषाको आधारभूत कुरा सिक्नेछौं।
प्रोग्रामिंगको अर्थ कोड लेख्ने हो। पुस्तक अध्याय, अनुच्छेद, वाक्य, शब्द र अन्तमा विराम चिह्न र अक्षरहरू मिलेर बनेको हुन्छ, त्यस्तै प्रोग्रामलाई पनि साना र साना कम्पोनेन्टहरूमा टुकराउन सकिन्छ। अहिलेको लागि, सबैभन्दा महत्त्वपूर्ण एक स्टेटमेन्ट हो। Statement स्टेटमेन्ट एक पुस्तकमा एक वाक्यको रूपैगी छ। आफैमा संरचना र उद्देश्य छ, तर वरपर अन्य स्टेटमेन्टहरूको सन्दर्भ बिना यो अर्थपूर्ण छैन।
स्टेटमेन्ट अधिक अनौपचारिक (र सामान्य रूपमा) लाइन अफ कोडको रूपमा परिचित छ। त्यो किनभने स्टेटमेन्ट व्यक्तिगत लाइनहरूमा लेखिएको हुन्छ। त्यस्तै, प्रोग्रामहरू माथिबाट तल पढिन्छ, बाँयाबाट दायाँ। तपाईं अझै पनि कोड(सोर्स कोड) के चाहि हो त भनेर सोच्दै हुनुहुन्छ होला। त्यो एउटा व्यापक शब्द हो जसले सम्पूर्ण प्रोग्राम वा सानो भागलाई जनाउन सक्छ। त्यसकारण, कोडको लाइन नै तपाईंको प्रोग्रामको लाइन हो।
यहाँ एक साधारण उदाहरण छ:
let hello = "Hello";
let world = "World";

// Message equals "Hello World"
let message = hello + " " + world;

यो कोडलाई इन्टपरपरेटर भनिने अर्को प्रोग्रामद्वारा एक्जिक्युट(execute) गर्न सकिन्छ जसले कोड पढ्छ, र सही क्रममा सबै स्टेटमेन्टहरू एक्जिक्युट गर्दछ।

basics/comments.html.body:
टिप्पणीहरू
टिप्पणीहरू (comments) बयानहरू हुन् जसले अन्य प्रोग्रामरहरू वा कुन् कोडले के काम गर्दछ भनेर जानकारी दिन्छन्।
जाभास्क्रिप्टमा, टिप्पणीहरू २  तरीकाले लेख्न सकिन्छ:

एकल रेखा टिप्पणीहरू: यो दुई फरवार्ड स्ल्याशहरू (//) बाट सुरु हुन्छ र रेखाको अन्त्यसम्म जारी रहन्छ। स्ल्याशहरू पछिको कुनै पनि कुरा जाभास्क्रिप्ट ईन्टरप्रेटरद्वारा कोडको रूपमा प्रसोधन गरिदैन। उदाहरणका लागि:

// यो एक टिप्पणी हो, यसलाई जाभास्क्रिप्ट ईन्टरप्रेटरद्वारा बेवास्ता गरिनेछ
let a = "this is a variable defined in a statement";


बहु-रेखा टिप्पणीहरू: अगाडिको स्ल्याश र ताराङ्कन (/*) बाट सुरु हुन्छ र ताराङ्कन र अगाडिको स्ल्याश (*/) सँग समाप्त हुन्छ। सुरु र अन्त्य चिन्हहरू बीचको कुनै पनि कुरा जाभास्क्रिप्ट ईन्टरप्रेटरद्वारा कोडको रूपमा प्रसोधन गरिदैन। उदाहरणका लागि:

/*
यो एक बहुरेखा टिप्पणी हो
जसलाई जाभास्क्रिप्ट ईन्टरप्रेटरद्वारा कोडको रूपमा प्रसोधन गरिदैन।
*/
let a = "this is a variable defined in a statement";

numbers/.body:
अध्याय ३
संख्याहरू
जाभास्क्रिप्टमा केवल एक प्रकारको नम्बर - 64-बिट फ्लोट पोइन्ट छ। यो जाभाको डबल जस्तै हो। अधिकांश अन्य प्रोग्रामिंग भाषाहरूको विपरीत, त्यहाँ कुनै अलग पूर्णांक प्रकार छैन, त्यसैले १ र १.० समान मान हो। संख्या सिर्जना गर्न सजिलो छ, यो var (वर) कुञ्जीशब्द प्रयोग गरेर कुनै पनि अन्य चर प्रकारको लागि जस्तै गर्न सकिन्छ।
संख्याहरू स्थिर मानबाट सिर्जना गर्न सकिन्छ।
// This is a float:
let a = 1.2;

// This is an integer:
let b = 10;

वा अर्को भ्यारीएबलको मानबाट।
let a = 2;
let b = a;

पूर्णांकको परिशुद्धता १५ अंकसम्म सही हुन्छ र अधिकतम संख्या १७ हुन्छ ।
let x = 999999999999999;   // x will be 999999999999999
let y = 9999999999999999;  // y will be 10000000000000000

यसले संख्यात्मक स्थिरांकलाई हेक्साडेसिमलको रूपमा व्याख्या गर्दछ यदि तिनीहरू 0x भन्दा पहिले छन्।
let z = 0xFF; // 255

strings/concat.html.body:
संयोजन
संयोजनमा दुई वा दुई भन्दा बढी स्ट्रिङहरू एकसाथ थप्नु समावेश छ, ती मूल स्ट्रिङहरूको संयुक्त डेटा समावेश गर्ने ठूलो स्ट्रिङ सिर्जना गर्दछ।  स्ट्रिङको संयोजनले एक वा एकभन्दा बढी स्ट्रिङलाई अर्को स्ट्रिङमा जोड्दछ।  यो जाभास्क्रिप्टमा निम्न तरिकाहरू प्रयोग गरेर गरिन्छ।

'+' अपरेटर प्रयोग गर्दै
concat() विधि प्रयोग गर्दै
सरणी join() विधि प्रयोग गर्दै
टेम्प्लेट शाब्दिक प्रयोग गर्दै (ईएस 6 मा प्रस्तुत)

स्ट्रिङ concat() विधिले स्ट्रिङको सूचीलाई प्यारामिटरको रूपमा स्वीकार गर्दछ र संयोजन पछि नयाँ स्ट्रिङ फर्काउँछ अर्थात् सबै स्ट्रिङहरूको संयोजन। जबकि एरे join() विधि एरेमा उपस्थित सबै तत्वहरूलाई एकल स्ट्रिङमा रूपान्तरण गरेर संयोजन गर्न प्रयोग गरिन्छ।
टेम्प्लेट शाब्दिक रूपमा ब्याकटिक (``) प्रयोग गर्दछ र मल्टिलाइन स्ट्रिङहरू सिर्जना गर्न र स्ट्रिङ इन्टरपोलेसन प्रदर्शन गर्न सजिलो तरिका प्रदान गर्दछ।$चिन्ह र घुंघराले ब्रेसेस${अभिव्यक्ति} प्रयोग गरेर ब्याकटिक भित्र अभिव्यक्ति प्रयोग गर्न सकिन्छ।
const icon = '👋';
// using template Strings
`hi ${icon}`;

// using join() Method
['hi', icon].join(' ');

// using concat() Method
''.concat('hi ', icon);

//  using + operator
'hi ' + icon;
// hi 👋

arrays/push.html.body:
पुश
अन्तिम अनुक्रमणिकालाई नयाँ थपिएको वस्तु बनाउने सरणीमा निश्चित वस्तुहरू धकेल्न सकिन्छ। यसले एरेको लम्बाइ परिवर्तन गर्दछ र नयाँ लम्बाइ फर्काउँछ।
यहाँ 'पुश' प्रयोग गर्नका लागि वाक्यरचना छ:
array.push(element1[, ...[, elementN]]);

element1, ..., elementN तर्कहरूले एरेको अन्त्यमा थपिने तत्वहरूको प्रतिनिधित्व गर्दछ।
उदाहरण को लागी:
let array = [1, 2, 3]; 
array.push(4); 

console.log(array); 

// Result: array = [1, 2, 3, 4]

तपाईँले एरे जस्तो वस्तु (जस्तै तर्क वस्तु वा नोडलिस्ट वस्तु) को अन्त्यमा तत्वहरू थप्न push पनि प्रयोग गर्न सक्नुहुन्छ, यसलाई Array.prototype.slice() विधि प्रयोग गरेर सरणीमा रूपान्तरण गरेर:
function printArguments() {
  let args = Array.prototype.slice.call(arguments);
  args.push('d', 'e', 'f');
  console.log(args);
}

printArguments('a', 'b', 'c'); // Result: ["a", "b", "c", "d", "e", "f"]

नोट गर्नुहोस् कि पुश विधि विधिले मूल एर्रे परिमार्जन गर्दछ। यसले नयाँ एरे सिर्जना गर्दैन।

arrays/indices.html.body:
सूचकांक
तपाइँसँग डेटा तत्वहरूको तपाईंको एरे छ, तर यदि तपाईं एक विशिष्ट तत्व पहुँच गर्न चाहनुहुन्छ भने के हुन्छ? यहीँबाट इन्डेक्स आउँछ । एक अनुक्रमणिका ले सरणीमा एक स्थानलाई बुझाउँछ। सूचकांकहरू तार्किक रूपमा एक-एक गरेर प्रगति गर्छन्, तर यो ध्यान दिनुपर्दछ कि एरेमा पहिलो अनुक्रमणिका ० हो, किनकि यो अधिकांश भाषाहरूमा छ। तपाईँले सरणीको अनुक्रमणिकालाई सङ्केत गर्दै हुनुहुन्छ भन्ने सङ्केत गर्न कोष्ठक [] प्रयोग गरिन्छ ।
// This is an array of strings
let fruits = ["apple", "banana", "pineapple", "strawberry"];

// We set the variable banana to the value of the second element of
// the fruits array. Remember that indices start at 0, so 1 is the
// second element. Result: banana = "banana"
let banana = fruits[1];

तपाईँले सरणीमा तत्वको मान सेट गर्न सरणी अनुक्रमणिका पनि प्रयोग गर्न सक्नुहुन्छ ।
let array = ['a', 'b', 'c', 'd', 'e'];
//  indices:  0    1    2    3    4
array[4] = 'f';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f']

याद गर्नुहोस् कि यदि तपाईँले सरणीको सीमा भन्दा बाहिरको अनुक्रमणिका प्रयोग गरेर तत्व पहुँच गर्न वा सेट गर्न प्रयास गर्नुभयो भने (जस्तै, ० भन्दा कम वा सरणीको लम्बाइभन्दा बढी वा बराबर अनुक्रमणिका), तपाईँले अपरिभाषित मान प्राप्त गर्नुहुनेछ।
console.log(array[5]); // Output: undefined
array[5] = 'g';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f', undefined, 'g']

