miscellaneous/hoisting.html.body:
होइस्टिंग
होस्टिङ जाभास्क्रिप्टमा पूर्वनिर्धारित व्यवहार हो जुन शीर्षमा घोषणाहरू सार्ने छ।  एक कोड कार्यान्वयन गर्दा, यसले विश्वव्यापी कार्यान्वयन सन्दर्भ सिर्जना गर्दछ: सिर्जना र कार्यान्वयन।  सिर्जना चरणमा, जाभास्क्रिप्टले चर र प्रकार्य घोषणालाई पृष्ठको शीर्षमा सार्दछ, जुन उत्थानको रूपमा चिनिन्छ।
// variable hoisting
console.log(counter);
let counter = 1; // throws ReferenceError: Cannot access 'counter' before initialization

यद्यपि 'काउन्टर' ढेर मेमोरीमा अवस्थित छ तर सुरु गरिएको छैन, यसले त्रुटि फ्याँक्छ। यो फहराउने कारण हुन्छ, 'काउन्टर' चर यहाँ फहराइन्छ।;
// function hoisting
const x = 20,
    y = 10;

let result = add(x,y); // ❌ Uncaught ReferenceError: add is not defined
console.log(result);

let add = (x, y) => x + y;


यहाँ, add प्रकार्य निस्कियो र विस्तृत जानकारीको रूपमा` अपरिभाइनको साथ आरम्भ गरिएको छ। यसैले, त्रुटि फ्याँक्दै।

miscellaneous/currying.html.body:
करिङ
'करिङ' कार्यात्मक प्रोग्रामिंगमा एक उन्नत प्रविधि हो जुन धेरै तर्कहरूको साथ एक प्रकार्यलाई नेस्टिंग प्रकार्यहरूको अनुक्रममा रूपान्तरण गर्दछ। यसले प्रकार्यलाई f(a,b,c) बाट f(a)(b)(c) को रूपमा कल गर्न योग्यमा रूपान्तरण गर्दछ। यसले प्रकार्यलाई कल गर्दैन बरु यसलाई रूपान्तरण गर्दछ।
करिङको राम्रो समझ प्राप्त गर्न एक साधारण add प्रकार्य थप्नुहोस् सिर्जना गरौं जुन तीन तर्कहरू लिन्छ र तिनीहरूको योगफल फर्काउँछ। त्यसपछि, हामी एक addCurry प्रकार्य सिर्जना गर्दछौं जसले एकल इनपुट लिन्छ र यसको योगफलको साथ प्रकार्यहरूको श्रृंखला फर्काउँछ।
// Noncurried version
const add = (a, b, c)=>{
    return a+ b + c
}
console.log(add(2, 3, 5)) // 10

// Curried version
const addCurry = (a) => {
    return (b)=>{
        return (c)=>{
            return a+b+c
        }
    }
}
console.log(addCurry(2)(3)(5)) // 10

यहाँ, हामी देख्न सक्छौं कि दुवै करीड र गैर-करी संस्करणहरूले समान परिणाम फर्काए। करी गर्नु धेरै कारणहरूको लागि लाभदायक हुन सक्छ, जसमध्ये केही यहाँ उल्लेख गरिएको छ।

यसले एउटै चरलाई बारम्बार पास गर्नबाट जोगिन मद्दत गर्दछ।

यसले प्रकार्यलाई एकल जिम्मेवारीको साथ सानो खण्डहरूमा विभाजन गर्दछ, जसले प्रकार्यलाई कम त्रुटि-प्रवण बनाउँदछ।

यो एक उच्च-क्रम प्रकार्य सिर्जना गर्न कार्यात्मक प्रोग्रामिंगमा प्रयोग गरिन्छ।

miscellaneous/linked-list.html.body:
लिङ्क गरिएको सूची
यो सबै प्रोग्रामिंग भाषाहरूमा पाइने एक सामान्य डेटा संरचना हो। लिङ्क गरिएको सूची जाभास्क्रिप्टमा सामान्य सरणीसँग धेरै मिल्दोजुल्दो छ, यसले थोरै फरक तरिकाले कार्य गर्दछ।
यहाँ सूचीको प्रत्येक तत्व एक अलग वस्तु हो जसमा लिङ्क वा अर्कोमा सूचक हुन्छ। जाभास्क्रिप्टमा लिङ्क गरिएको सूचीहरूको लागि कुनै बिल्ट-इन विधि वा प्रकार्य छैन त्यसैले यसलाई कार्यान्वयन गर्नु पर्दछ। लिङ्क गरिएको सूचीको उदाहरण तल देखाइएको छ।
["one", "two", "three", "four"]
लिंक गरिएको सूचीको प्रकार
त्यहाँ तीन प्रकारका लिङ्क गरिएका सूचीहरू छन्:

एकल लिङ्क सूचीहरू: प्रत्येक नोडले अर्को नोडमा केवल एक सूचक समावेश गर्दछ।
डबल लिङ्क गरिएको सूचीहरू: प्रत्येक नोडमा दुई पोइन्टरहरू छन्, अर्को नोडमा एक र अघिल्लो नोडमा एक।
सर्कुलर लिङ्क गरिएको सूचीहरू: एक परिपत्र लिङ्क गरिएको सूचीले अन्तिम नोडलाई पहिलो नोड वा यसको अगाडि कुनै अन्य नोडलाई इंगित गरेर लूप बनाउँदछ।

जोड्नु
लिङ्क गरिएको सूचीमा मान थप्न यहाँ add विधि सिर्जना गरिएको छ ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    append = (value) => {
        const newNode = new Node(value) 
        let current = this.head 
        if (!this.head) {
            this.head = newNode 
            return 
        }
        while (current.next) {
            current = current.next
        }
        current.next = newNode
    }
}

पप
यहाँ, लिङ्क गरिएको सूचीबाट मान हटाउन 'पप' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    pop = () => {
        let current = this.head 
        while (current.next.next) {
            current = current.next 
        }
        current.next = current.next.next 
    }
}

प्रिपेन्ड
यहाँ, लिङ्क गरिएको सूचीको पहिलो बच्चा भन्दा पहिले मान थप्न 'प्रिपेन्ड' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    prepend = (value) => {
        const newNode = new Node(value)
        if (!this.head) {
            this.head = newNode 
        }
        else {
            newNode.next = this.head 
            this.head = newNode 
        }
    }
}

सिफ्ट
यहाँ, लिङ्क गरिएको सूचीको पहिलो तत्व हटाउन 'सिफ्ट' विधि सिर्जना गरिएको छ।
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    shift = () => {
        this.head = this.head.next 
    }
}

miscellaneous/global-footprint.html.body:
ग्लोबल पदचिह्न
यदि तपाईं मोड्युल विकास गर्दै हुनुहुन्छ, जुन वेब पृष्ठमा चलिरहेको हुन सक्छ, जसले अन्य मोड्युलहरू पनि चलाउँदछ, त्यसपछि तपाईंले चर नाम ओभरल्यापिङको बारेमा सावधान हुनुपर्दछ।
मानौं हामी काउन्टर मोड्युल विकास गर्दैछौं:
let myCounter = {
  number: 0,
  plusPlus: function () {
    this.number = this.number + 1;
  },
  isGreaterThanTen: function () {
    return this.number > 10;
  },
};


नोट: आन्तरिक अवस्थालाई बाहिरबाट अपरिवर्तनीय बनाउन यो प्रविधि प्रायः बन्द गरेर प्रयोग गरिन्छ।

मोड्युलले अब केवल एक चर नाम लिन्छ - myCounter। यदि पृष्ठमा कुनै अन्य मोड्युलले 'नम्बर' वा isGreaterThanTen जस्ता नामहरू प्रयोग गर्दछ भने यो पूर्ण रूपमा सुरक्षित छ किनकि हामी एक अर्काको मानहरू ओभरराइड गर्नेछैनौं।

miscellaneous/debugging.html.body:
डिबगिंग
प्रोग्रामिंगमा, कोड लेख्दा त्रुटिहरू हुन सक्छ। यो वाक्यात्मक वा तार्किक त्रुटिहरूको कारण हुन सक्छ। त्रुटिहरू फेला पार्ने प्रक्रिया समय-खपत र पेचिलो हुन सक्छ र यसलाई कोड डिबगिंग भनिन्छ।
सौभाग्यवश, अधिकांश आधुनिक ब्राउजरहरू बिल्ट-इन डिबगरहरूसँग आउँछन्। यी डिबगरहरू स्विच अन र अफ गर्न सकिन्छ, जसले त्रुटिहरू रिपोर्ट गर्न बाध्य पार्छ। कार्यान्वयन रोक्न र चरहरूको जाँच गर्न कोडको कार्यान्वयनको क्रममा ब्रेकपोइन्टहरू सेट अप गर्न पनि सम्भव छ। यसको लागि डिबगिङ विन्डो खोल्नुपर्छ र जाभास्क्रिप्ट कोडमा 'डिबगर' कीवर्ड राख्नुपर्छ। कोड कार्यान्वयन प्रत्येक ब्रेकपोइन्टमा रोकिन्छ, विकासकर्ताहरूलाई जाभास्क्रिप्ट मानहरू जाँच गर्न र कोडको कार्यान्वयन पुन: सुरु गर्न अनुमति दिन्छ।
डिबगर सञ्झ्यालमा जाभास्क्रिप्ट मान मुद्रण गर्न console.log() विधि पनि प्रयोग गर्न सकिन्छ ।
const a = 5, b = 6;
const c = a + b;
console.log(c);
// Result : c = 11;

exercises/constants.html.body:
स्थिरहरू
स्थिरहरू ईएस ६ (2015) मा प्रस्तुत गरिएको थियो, र कन्स्ट कीवर्ड प्रयोग गर्दछ। कन्स्ट सँग घोषणा गरिएका भेरिएबलहरू पुन: असाइन गर्न वा पुन: परिभाषित गर्न सकिँदैन।
उदाहरण
const VERSION = "1.2";

