	    Solution

modules.html.body:
अध्याय १३
मोड्युलहरू
वास्तविक संसारमा, एक प्रोग्राम नयाँ कार्यक्षमताको आवश्यकताहरूको सामना गर्न व्यवस्थित रूपमा बढ्छ। बढ्दो कोडबेस संरचना र कोड को रखरखाव को साथ अतिरिक्त काम को आवश्यकता छ। यद्यपि यसले भविष्यमा भुक्तानी गर्नेछ, यसलाई बेवास्ता गर्न र प्रोग्राम हरूलाई गहिरो रूपमा पेचिलो हुन अनुमति दिन यो लोभलाग्दो छ। वास्तविकतामा, यसले अनुप्रयोगको जटिलता बढाउँछ, किनकि एक प्रणालीको समग्र समझ निर्माण गर्न बाध्य हुन्छ र अलगावमा कुनै पनि टुक्रा हेर्न गाह्रो हुन्छ। दोस्रो, यसको कार्यक्षमता को उपयोग गर्न को लागी एक अनटैंगलिंग मा अधिक समय लगानी गर्नु पर्छ।
मोड्युलहरू यी समस्याहरूबाट बच्न आउँदछन्। एक 'मोड्युल' ले निर्दिष्ट गर्दछ कि यो कोडको कुन टुक्राहरूमा निर्भर गर्दछ, साथै यसले अन्य मोड्युलहरू प्रयोग गर्नका लागि कुन कार्यक्षमता प्रदान गर्दछ। मोड्युलहरू जुन अन्य मोड्युलमा निर्भर छन् तिनीहरूलाई _निर्भरताहरू' भनिन्छ। विभिन्न मोड्युल पुस्तकालयहरू मोड्युलहरूमा कोड व्यवस्थित गर्न र मागमा लोड गर्न त्यहाँ छन्।

AMD - सबैभन्दा पुरानो मोड्युल प्रणाली मध्ये एक हो। सुरुमा यो require.js प्रयोग गरियो।
CommonJS - मोड्युल प्रणाली नोड ट्रान्स सर्भर को लागी सिर्जना गरिएको हो।।
UMD - मोड्युल प्रणाली जुन AMD र CommonJS सँग उपयुक्त छ।

मोड्युलहरूले एक अर्कालाई लोड गर्न सक्दछन्, र कार्यक्षमता आदानप्रदान गर्न विशेष निर्देशनहरू आयात र निर्यात प्रयोग गर्न सक्दछन्, र एक अर्काको कार्यहरू कल गर्न सक्दछन्।

निर्यात (export) ले लेबलहरू कार्यहरू र चरहरू जुन हालको मोड्युल बाहिरबाट पहुँच योग्य हुनुपर्दछ।
आयात (import) - बाहिर मोड्युलबाट कार्यक्षमता आयात गर्दछ।

मोड्युलमा 'आयात' र 'निर्यात' संयन्त्र हेरौं। हामीसँग sayHi प्रकार्य sayHi.js फाइलबाट निर्यात गरिएको छ।
// 📁 sayHi.js
export const sayHi = (user) => {
    alert(`Hello, ${user}!`);
};

'आयात' निर्देशनको सहायताले main.js फाइलमा sayHi प्रकार्य खपत हुन्छ।
// 📁 main.js
import { sayHi } from "./sayHi.js";

alert(sayHi); // function...
sayHi("Kelvin"); // Hello, Kelvin!

यहाँ, आयात निर्देशिकाले सापेक्ष पथ आयात गरेर मोड्युल लोड गर्दछ र sayHi चर प्रदान गर्दछ।
मोड्युलहरू दुई तरिकामा निर्यात गर्न सकिन्छ: नाम र पूर्वनिर्धारित । यसबाहेक, नामित निर्यातहरू इनलाइन वा व्यक्तिगत रूपमा तोक्न सकिन्छ।
// 📁 person.js

// inlined named exports
export const name = "Kelvin";
export const age = 30;

// at once
const name = "Kelvin";
const age = 30;
export { name, age };

एउटा फाइलमा एउटा मात्र पूर्वनिर्धारित 'निर्यात' हुन सक्छ ।

// 📁 message.js
const message = (name, age) => {
    return `${name} is ${age} years old.`;
};
export default message;


निर्यातको प्रकारका आधारमा हामी यसलाई दुई तरिकाले आयात गर्न सक्छौं। नामित निर्यात घुंघराले ब्रेसेस प्रयोग गरेर निर्माण गरिएको छ जबकि, पूर्वनिर्धारित निर्यात हरू छैनन्।
import { name, age } from "./person.js"; // named export import
import message from "./message.js"; // default export import

मोड्युलहरू निर्दिष्ट गर्दा, हामीले circular dependency बच्नुपर्छ। सर्कुलर निर्भरता एक स्थिति हो जहाँ मोड्युल ए बी मा निर्भर गर्दछ, र बी पनि प्रत्यक्ष वा अप्रत्यक्ष रूपमा ए मा निर्भर गर्दछ।

classes/.body:
अध्याय १५
वर्ग
वर्गहरू (classes) वस्तु सिर्जना गर्न टेम्प्लेटहरू हुन्। यसले डेटाको साथ काम गर्न कोडको साथ डेटा लाई समाहित गर्दछ। कुञ्जीशब्द 'वर्ग' वर्ग सिर्जना गर्न प्रयोग गरिन्छ।  र 'कन्स्ट्रक्टर' नामक एक विशिष्ट विधि 'वर्ग' को साथ सिर्जना गरिएको वस्तु सिर्जना गर्न र सुरु गर्न प्रयोग गरिन्छ। कार वर्गको एक उदाहरण तल देखाइएको छ।
class Car {
  constructor(name, year) {
    this.name = name;
    this.year = year;
  }
  age() {
    let date = new Date();
    return date.getFullYear() - this.year;
  }
}

let myCar = new Car("Toyota", 2021);
console.log(myCar.age()) // 1

वर्ग यसको प्रयोग गर्नु अघि परिभाषित गर्नु पर्दछ।

वर्ग शरीरमा, विधिहरू वा कन्स्ट्रक्टरहरू परिभाषित गरिन्छ र strict mode मा कार्यान्वयन गरिन्छ। वाक्यविन्यासले कडा मोडको पालना नगर्दा त्रुटि हुन्छ ।

classes/static.html.body:
स्थिर
'स्थिर' कीवर्डले वर्गको लागि स्थिर विधिहरू वा गुणहरू परिभाषित गर्दछ।  यी विधिहरू र गुणहरू वर्गमा नै भनिन्छ।
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
}
let myCar = new Car("Toyota");

console.log(myCar.hello()); // This will throw an error
console.log(Car.hello(myCar));
// Result: Hello Toyota

this कीवर्ड प्रयोग गरेर उही वर्गको अर्को स्थिर विधिको स्थिर विधि वा गुण पहुँच गर्न सक्छ।

classes/inheritance.html.body:
उत्तराधिकार
उत्तराधिकार कोड पुन: प्रयोज्य उद्देश्यहरूको लागि उपयोगी छ किनकि यसले एक वर्गको अवस्थित गुणहरू र विधिहरू विस्तार गर्दछ। वर्ग वंशानुक्रम सिर्जना गर्न extends कीवर्ड प्रयोग गरिन्छ।
class Car {
  constructor(brand) {
    this.carname = brand;
  }
  present() {
    return 'I have a ' + this.carname;
  }
}

class Model extends Car {
  constructor(brand, mod) {
    super(brand);
    this.model = mod;
  }
  show() {
    return this.present() + ', it is a ' + this.model;
  }
}

let myCar = new Model("Toyota", "Camry");
console.log(myCar.show()); // I have a Camry, it is a Toyota.

अभिभावक वर्गको प्रोटोटाइप 'वस्तु' वा 'शून्य' हुनुपर्दछ।

'सुपर' विधि कन्स्ट्रक्टर भित्र प्रयोग गरिन्छ र मूल वर्गलाई बुझाउँछ। यसको साथ, एक अभिभावक वर्ग गुणहरू र विधिहरू पहुँच गर्न सक्दछ।

events.html.body:
अध्याय १७
घटनाहरू
प्रोग्रामिंगमा, घटनाहरू प्रणालीमा कार्यहरू वा घटनाहरू हुन् जुन प्रणालीले तपाईंलाई सूचित गर्दछ ताकि तपाईं तिनीहरूलाई प्रतिक्रिया दिन सक्नुहुनेछ। उदाहरणका लागि, जब तपाईं रिसेट बटन क्लिक गर्नुहुन्छ यसले इनपुट खाली गर्दछ।
कुञ्जीपाटीबाट (keyboard) अन्तर्क्रियाहरू जस्तै किप्रेसहरू फेरि जारी गर्नु अघि कुञ्जीको अवस्था समात्न निरन्तर पढ्न आवश्यक छ। अन्य समय-गहन गणनाहरू प्रदर्शन गर्दा तपाईंलाई कुञ्जी प्रेस छुट्न सक्छ। यो केही आदिम मेशिनहरूको इनपुट ह्यान्डलिङ संयन्त्र थियो। अर्को कदम एक लाइन प्रयोग गर्न छ, अर्थात् एक प्रोग्राम जुन समय-समयमा नयाँ घटनाहरूको लागि लाइन जाँच गर्दछ र यसमा प्रतिक्रिया गर्दछ। यो दृष्टिकोणलाई polling भनिन्छ।
यस दृष्टिकोणको मुख्य दोष यो हो कि यसले हरेक समय लाइनमा हेर्नुपर्छ, जब एक घटना ट्रिगर हुन्छ तब व्यवधान उत्पन्न हुन्छ। यसको लागि राम्रो संयन्त्र भनेको घटना घट्दा कोडलाई सूचित गर्नु हो। यो आधुनिक ब्राउजरहरूले हामीलाई विशिष्ट घटनाहरूको लागि ह्यान्डलरहरूको रूपमा प्रकार्यहरू दर्ता गर्न अनुमति दिएर के गर्दछ।
Click me to activate the handler.
ह्यान्डलर सक्रिय पार्न मलाई क्लिक गर्नुहोस् ।

  window.addEventListener("click", () => {
    console.log("clicked");
  });


यहाँ, एडइभेन्ट लिस्टनर (addEventListener) लाई सञ्झ्याल (window) वस्तु (ब्राउजरद्वारा प्रदान गरिएको बिल्ट-इन वस्तु) मा सम्पूर्ण सञ्झ्याल का लागि ह्यान्डलर दर्ता गर्न भनिन्छ। यसको एडइभेन्ट लिस्टनर विधिलाई कल गर्दा यसको पहिलो तर्कद्वारा वर्णन गरिएको घटना हुँदा दोस्रो तर्क लाई भनिन्छ।
घटना श्रोताहरूलाई तब मात्र बोलाइन्छ जब घटना उनीहरूले दर्ता गरेको वस्तुको सन्दर्भमा हुन्छ।

केहि सामान्य HTML घटनाहरू उल्लेख गरिएका छन्।



Event
Description




onchange
When the user changes or modifies the value of form input


onclick
When the user clicks on the element


onmouseover
When cursor of the mouse comes over the element


onmouseout
When cursor of the mouse comes leaves the element


onkeydown
When the user press and then releases the key


onload
When the browser has finished the loading






घटना
विवरण




onchange
जब प्रयोगकर्ताले फारम आगतको मान परिवर्तन वा परिमार्जन गर्दछ


onclick
जब प्रयोगकर्ताले तत्वमा क्लिक गर्दछ


onmouseover
जब माउसको कर्सर तत्वमाथि आउँछ


onmouseout
जब माउसको कर्सर आउँछ तत्व छोड्छ


onkeydown
जब प्रयोगकर्ताले प्रेस गर्दछ र त्यसपछि कुञ्जी जारी गर्दछ


